INSERT INTO `cms_article_data` VALUES ('43480', '<p>\r\n	央行发布公告称，&nbsp;临近月末财政支出力度加大，对冲央行逆回购到期后银行体系流动性处于较高水平，6月28日不开展公开市场操作。</p>\r\n<p>\r\n	　　这是央行连续第四天暂停公开市场操作，今日有500亿元逆回购到期，故公开市场今日实现净回笼500亿。</p>\r\n<p>\r\n	　　中证报报道引述市场人士评价称，&ldquo;感觉遇到了假6月！&rdquo;半年末大考在即，市场资金面竟是一派宽松景象，货币市场利率持续走低，央行则连续实施净回笼，仍无碍市场对流动性的乐观预期继续发酵。对于很多市场人士来说，这恐怕是近些年过得最轻松的一个6月。　　</p>\r\n<p>\r\n	　　一般年份，6月往往是流动性最紧张的时刻。证券时报称今年6月，受MPA（宏观审慎评估）考核、财政缴税、美联储加息预期等因素影响，市场流动性也面临不小压力。而上周央行实现资金净回笼600亿，近期公开市场操作资金实现净回笼，间接表明流动性紧张已经得到改善。可以看出前期的市场净投放，已经在很大程度上缓解了6月份的流动性压力，季末资金紧张时点已过。</p>\r\n<div class=\"img_wrapper\">\r\n	<img alt=\"质押式回购成交行情\" data-link=\"\" src=\"http://n.sinaimg.cn/finance/transform/20170628/kHHO-fyhneam4748824.png\" /><span class=\"img_descr\">质押式回购成交行情</span></div>\r\n<div class=\"otherContent_01\" id=\"ad_44099\" style=\"display: block; margin: 10px 20px 10px 0px; float: left; overflow: hidden; clear: both; padding: 4px; width: 300px; height: 250px;\">\r\n	&nbsp;</div>\r\n<p>\r\n	　　资金的宽松直接体现在了市场利率上，今日银质押1天回购利率开盘下跌6.22个基点，报2.4750%；7天回购利率开盘下跌12.37个基点，报2.6568%，显示银行体系流动性充裕。</p>\r\n<p>\r\n	　　近期货币市场流动性并未因央行重启净回笼而出现太大波动，27日，银质押回购利率涨跌互现。其中，D<span id=\"stock_sh206001\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh206001/nc.shtml\" target=\"_blank\">R001</a></span>加权平均利率续跌12BP至2.54%，D<span id=\"stock_sh206007\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh206007/nc.shtml\" target=\"_blank\">R007</a></span>利率小涨2BP至2.78%，可跨季的14天回购D<span id=\"stock_sh206014\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh206014/nc.shtml\" target=\"_blank\">R014</a></span>利率下行2BP。</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('43483', '<div class=\"page-header\">\r\n	<h1 id=\"artibodyTitle\">\r\n		香港仙股集体闪崩原因浮出：普遍关联持股 多与隆成系有关</h1>\r\n</div>\r\n<div class=\"page-info\">\r\n	<span class=\"time-source\">2017年06月28日08:02 新浪综合 </span>\r\n	<div class=\"page-tools\">\r\n		&nbsp;</div>\r\n</div>\r\n<div class=\"left\">\r\n	<div class=\"l_banner1\">\r\n		&nbsp;</div>\r\n	<div class=\"article article_16\" id=\"artibody\">\r\n		<div class=\"ct_hqimg\">\r\n			<div class=\"hqimg_wrapper\">\r\n				<a href=\"http://stock.finance.sina.com.cn/hkstock/quotes/hsi.html\" target=\"_blank\"><img alt=\"\" src=\"http://image.sinajs.cn/newchar/png/k/hk/daily_660/hsi.png\" /></a></div>\r\n			<div class=\"hqimg_related\">\r\n				<div class=\"to_page\">\r\n					<span>热点栏目</span> <a href=\"http://vip.stock.finance.sina.com.cn/moneyflow/\" target=\"_blank\">资金流向</a> <a href=\"http://vip.stock.finance.sina.com.cn/q/go.php/vInvestConsult/kind/qgqp/index.phtml?symbol=000651\" target=\"_blank\">千股千评</a> <a href=\"http://finance.sina.com.cn/stock/message/gxq/sz000651/ggzd.htm\" target=\"_blank\">个股诊断</a> <a href=\"http://vip.stock.finance.sina.com.cn/q/go.php/vIR_StockSearch/key/000651.phtml\" target=\"_blank\">最新评级</a> <a href=\"http://i.finance.sina.com.cn/chaogu/?f=caishou#cGFyZW50OmJ1eSY=\" target=\"_blank\">模拟交易</a></div>\r\n				<a class=\"hqimg_client\" href=\"http://m.sina.com.cn/m/finance.html\" style=\"background:url(\'http://n.sinaimg.cn/780c44e8/20150702/hqimg_client.gif\') no-repeat 0px 11px;\" target=\"_blank\">客户端</a></div>\r\n		</div>\r\n		<div class=\"finance_app_zqtg\">\r\n			<p>\r\n				<img alt=\"Level2\" height=\"32px\" src=\"http://www.sinaimg.cn/cj/deco/2013/1018/img/icon.png\" title=\"Level2\" width=\"32px\" /><a href=\"http://finance.sina.com.cn/mobile/comfinanceweb.shtml\" target=\"_blank\"><span> 新浪财经App：直播上线 博主一对一指导</span></a> <a href=\"http://api.ggt.sina.com.cn/download/download.html\" target=\"_blank\"> <img alt=\"港股level2行情\" src=\"http://n.sinaimg.cn/finance/04ef3be0/20160801/150517773373600357.jpg\" /> <span>新浪港股APP：实时行情 独家内参</span></a></p>\r\n		</div>\r\n		<p>\r\n			　　来源：澎湃新闻</p>\r\n		<p>\r\n			　　港交所多只&ldquo;仙股&rdquo;闪崩的原因浮出水面。</p>\r\n		<p>\r\n			　　6月27日晚间，香港证监会发言人Ernest Kong表示，当天股价大幅下挫的股票，多有与不同公司和上市券商存在多重关联、持股集中度高、成交量小、流通股少等特点。这些特点容易导致股价极度波动和市场失当行为。</p>\r\n		<p>\r\n			　　Kong表示，香港证监会不便证实是否已经或正在寻求对具体个人或相关公司展开调查。</p>\r\n		<p>\r\n			　　澎湃新闻了解到，这批闪崩的仙股背后，隐约闪现着一家名为<span id=\"hkstock_hk01225\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/01225.html\" target=\"_blank\">隆成金融</a></span><span id=\"quote_hk01225\">(<font color=\"red\">0</font>, <font color=\"red\">-0.13</font>, <font color=\"red\">-100.00%</font>)</span>的公司。此次闪崩仙股中跌幅排名前两位的个股&mdash;&mdash;<span id=\"hkstock_hk01027\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/01027.html\" target=\"_blank\">中国集成控股</a></span><span id=\"quote_hk01027\">(<font color=\"black\">0.015</font>, <font color=\"black\">-0.00</font>, <font color=\"black\">-6.25%</font>)</span>和<span id=\"hkstock_hk08193\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/08193.html\" target=\"_blank\">汉华专业服务</a></span><span id=\"quote_hk08193\">(<font color=\"red\">0.059</font>, <font color=\"red\">-0.01</font>, <font color=\"red\">-7.81%</font>)</span>，有一家名为贝格隆的证券公司分别持有9.73%和10.39%的股份。而贝格隆证券公司，属隆成金融旗下企业。</p>\r\n		<p>\r\n			　　据此，有市场人士指出，不排除这次的闪崩潮是与隆成系有关。</p>\r\n		<p>\r\n			　　6月27日午市收盘之前，多只港交所上市股票突然急速下挫，股价&ldquo;腰斩&rdquo;的不在少数。下午交易时段，这些股票毫无恢复元气的迹象，直到16时收盘，有10家主板上市公司和3家创业板上市公司的股价跌幅在50%以上。</p>\r\n		<p>\r\n			　　其中，中国集成控股（01027.HK）暴跌94.29%，汉华专业服务（08193.HK）暴跌93.40%，<span id=\"hkstock_hk08217\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/08217.html\" target=\"_blank\">联旺集团</a></span><span id=\"quote_hk08217\">(<font color=\"green\">1.2</font>, <font color=\"green\">0.14</font>, <font color=\"green\">13.21%</font>)</span>（08217.HK）、<span id=\"hkstock_hk08021\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/08021.html\" target=\"_blank\">汇隆控股</a></span><span id=\"quote_hk08021\">(<font color=\"black\">0.028</font>, <font color=\"black\">-0.00</font>, <font color=\"black\">-12.50%</font>)</span>（08121.HK）美捷汇控股（01389.HK）重挫80%以上。隽泰控股（00630.HK）、<span id=\"hkstock_hk00802\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/00802.html\" target=\"_blank\">中国钱包</a></span><span id=\"quote_hk00802\">(<font color=\"red\">0.172</font>, <font color=\"red\">-0.02</font>, <font color=\"red\">-11.79%</font>)</span>（00802.HK）、<span id=\"hkstock_hk00243\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/00243.html\" target=\"_blank\">品质国际</a></span><span id=\"quote_hk00243\">(<font color=\"red\">0.245</font>, <font color=\"red\">-0.04</font>, <font color=\"red\">-14.04%</font>)</span>（00243.HK）、<span id=\"hkstock_hk00205\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/00205.html\" target=\"_blank\">财讯传媒</a></span><span id=\"quote_hk00205\">(<font color=\"black\">0.038</font>, <font color=\"black\">-0.00</font>, <font color=\"black\">-9.52%</font>)</span>（00205.HK）、<span id=\"hkstock_hk01226\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/01226.html\" target=\"_blank\">中国投融资</a></span><span id=\"quote_hk01226\">(<font color=\"red\">0.113</font>, <font color=\"red\">-0.01</font>, <font color=\"red\">-8.87%</font>)</span>（01226.HK）等跌幅在50%以上。</p>\r\n		<p>\r\n			　　值得一提的是，这些暴跌的股票，大多是股价不超过1港元的&ldquo;仙股&rdquo;。</p>\r\n		<p>\r\n			　　<span id=\"hkstock_hk03329\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/03329.html\" target=\"_blank\">交银国际</a></span><span id=\"quote_hk03329\">(<font color=\"red\">2.46</font>, <font color=\"red\">-0.01</font>, <font color=\"red\">-0.41%</font>)</span>董事总经理、研究部负责人洪灏对澎湃新闻记者表示，这种&ldquo;仙股&rdquo;集体暴跌的行情，大概率是爆仓所致。</p>\r\n		<p>\r\n			　　据洪灏分析，有可能是大股东资金紧张，导致机构抛出大股东质押在机构处的股票，从而引发的连环反应。</p>\r\n		<p>\r\n			　　在港股市场上，尤其是这些股价极低的&ldquo;仙股&rdquo;，通常成交并不活跃，如果股东将名下的股票质押在券商处，券商以这些股票作为抵押品，借出一定资金，但这笔资金出借通常有一定期限，当股东面临资金链断裂等情况，而无力还钱换券时，就会导致机构抛售股票换取资金的情况。</p>\r\n		<p>\r\n			　　这样的情况，在过去的港股市场并不少见，但如此大面积的集体闪崩，确实非常少见。</p>\r\n		<p>\r\n			　　查询这些股票的持股信息后可以发现，背后浮出水面的机构是隆成金融旗下的贝格隆证券公司，对于跌幅排行榜的前两名&mdash;&mdash;中国集成控股和汉华专业服务，贝格隆分别持有9.73%和10.39%的股份。</p>\r\n		<p>\r\n			　　有市场人士指出，不排除这次的闪崩潮是与隆成系有关，贝格隆所持仓的一些低价股也有可能继续下探。</p>\r\n		<p>\r\n			　　隆成金融（01225.HK）也是港股上市公司，自6月6日起被停牌，停牌前报0.127港元。</p>\r\n		<p>\r\n			　　根据2016年年报，隆成金融的现任荣誉主席是黄英源，其持有公司15.9%的股份，新任主席兼行政总裁是麦光耀。黄英源是公司的创始人，而麦光耀具有会计师背景，曾任<span id=\"hkstock_hk01019\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/01019.html\" target=\"_blank\">康宏环球</a></span><span id=\"quote_hk01019\">(<font color=\"red\">0.12</font>, <font color=\"red\">-0.02</font>, <font color=\"red\">-15.49%</font>)</span>（01019.HK）行政总裁，及<span id=\"hkstock_hk08081\"><a class=\"keyword\" href=\"http://stock.finance.sina.com.cn/hkstock/quotes/08081.html\" target=\"_blank\">互娱中国</a></span><span id=\"quote_hk08081\">(<font color=\"red\">0</font>, <font color=\"red\">-0.03</font>, <font color=\"red\">-100.00%</font>)</span>（08081.HK）的执行董事。</p>\r\n		<p>\r\n			　　隆成金融的财技之多让人有些眼花缭乱。除了2015年提出的&ldquo;1股多3股&rdquo;的配股计划，2016年，该公司又提出了每持有一股合并股份，可认购两股供股股份的供股计划，发行15.35亿股，筹资3.01亿港元。</p>\r\n		<p>\r\n			　　值得留意的是，隆成金融6月6日的停牌并非主动申请，而是被香港证监会责令停牌。理由是，香港证监会认为该公司在日期为2015年10月26日、内容有关2015年8月17日宣布的公开发售的公告，包括重大失实、不完整或错误引导资料。出于保护所有投资者或该公司股份投资者来说，暂停股票买卖是适宜之举。</p>\r\n		<p>\r\n			　　稍早前的5月15日，港股市场的独立股评人David Webb曾发文提醒投资者，避开50只风险较高的股份。</p>\r\n		<p>\r\n			　　有香港市场人士向澎湃新闻记者表示，这些被&ldquo;点名&rdquo;的股份很多都有贝格隆的持仓。而从6月27日的市场表现来看，多数&ldquo;中招&rdquo;的股票恰恰就在这份名单之中。</p>\r\n		<p>\r\n			　　这50家上市公司的股权关系复杂，属于互相持股。上市公司买入另一家公司的股份，出发点可能并不是出于股东的利益，而是为了&ldquo;凑数&rdquo;，帮后者提出的议案更加容易获得股东会的通过。</p>\r\n		<p>\r\n			　　简单来说，如果A公司购入B公司的部分股权，就在B公司的股东大会上有了一席之地，可以帮助B公司在投票时获得更多的赞成票。然后以此类推，B公司再投资C公司，C公司再投资回A公司，就形成了一个互相受益的利益链条。</p>\r\n		<p>\r\n			　　这50只股份的相互持股关系如下图所示，可谓错综复杂。</p>\r\n		<div class=\"img_wrapper\">\r\n			<img alt=\"\" border=\"0\" src=\"http://n.sinaimg.cn/finance/crawl/20170628/O4qh-fyhneam4671026.jpg\" /></div>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('43485', '<p>\r\n	<img src=\"https://img.alicdn.com/imgextra/i3/2186643866/TB2eoekkFXXXXctXXXXXXXXXXXX_!!2186643866.png\" /></p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('43487', '<div class=\"page-header\">\r\n	<h1 id=\"artibodyTitle\">\r\n		减持新规显效 大宗交易等三大方面呈现明显变化</h1>\r\n</div>\r\n<div class=\"page-info\">\r\n	<span class=\"time-source\">2017年06月28日06:59 证券日报 </span>\r\n	<div class=\"page-tools\">\r\n		&nbsp;</div>\r\n</div>\r\n<div class=\"left\">\r\n	<div class=\"l_banner1\">\r\n		&nbsp;</div>\r\n	<div class=\"article article_16\" id=\"artibody\">\r\n		<p>\r\n			　　■本报记者 张 颖 任小雨 吴 珊</p>\r\n		<p>\r\n			　　编者按：5月27日，证监会发布《上市公司股东、董监高减持股份的若干规定》，深沪交易所同时出台细则，完善减持规定。减持新规实施一个月以来，从产业资本增减持、大宗交易以及定增等三方面来看，新规效果较为明显。分析人士认为，新规降低了股东减持对市场的冲击，体现了监管层对A股的呵护态度，提振了市场信心，促进了近期的市场反弹。今日本文从上述三方面梳理分析减持新规实施一个月以来出现的市场变化，以飨读者。</p>\r\n		<p>\r\n			　　<strong>产业资本净增持金额为107.7亿元</strong></p>\r\n		<p>\r\n			　　《证券日报》市场研究中心根据<span id=\"stock_sz300033\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300033/nc.shtml\" target=\"_blank\">同花顺</a></span><span id=\"quote_sz300033\">(<font color=\"green\">61.080</font>, <font color=\"green\">-0.72</font>, <font color=\"green\">-1.17%</font>)</span>数据统计发现，5月27日以来截至6月27日（20个交易日），沪深两市共有319家公司出现产业资本买卖变动（二级市场），231家公司产业资本合计增持市值为130.4亿元，76家公司产业资本合计减持市值为22.7亿元，较5月27日以前的20个交易日减持金额44亿元，下降21.3亿元，下降幅度达48.41%；近1个月内净增持部分参考市值约为107.7亿元，较5月27日以前的20个交易日净增持金额89.58亿元上升18.12亿元，上升幅度为20.23%。梳理发现，减持新规实施以来，上市公司股东套现资金出现大幅下降，产业资本增持意愿呈现上升的趋势。</p>\r\n		<p>\r\n			　　从产业资本净增持角度来看，上述231只个股中，有32只个股产业资本期间净增持金额超1亿元，<span id=\"stock_sz002310\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002310/nc.shtml\" target=\"_blank\">东方园林</a></span><span id=\"quote_sz002310\">(<font color=\"green\">17.280</font>, <font color=\"green\">-0.01</font>, <font color=\"green\">-0.06%</font>)</span>、<span id=\"stock_sh600177\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600177/nc.shtml\" target=\"_blank\">雅戈尔</a></span><span id=\"quote_sh600177\">(<font color=\"green\">10.240</font>, <font color=\"green\">-0.01</font>, <font color=\"green\">-0.10%</font>)</span>、<span id=\"stock_sz000961\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000961/nc.shtml\" target=\"_blank\">中南建设</a></span><span id=\"quote_sz000961\">(<font color=\"green\">6.480</font>, <font color=\"green\">-0.04</font>, <font color=\"green\">-0.61%</font>)</span>、<span id=\"stock_sz300159\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300159/nc.shtml\" target=\"_blank\">新研股份</a></span><span id=\"quote_sz300159\">(<font color=\"green\">13.030</font>, <font color=\"green\">-0.10</font>, <font color=\"green\">-0.76%</font>)</span>等4只个股产业资本期间净增持金额均在5亿元以上，分别为：12.41亿元、10.08亿元、7.23亿元和5.34亿元，另外，<span id=\"stock_sz002335\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002335/nc.shtml\" target=\"_blank\">科华恒盛</a></span><span id=\"quote_sz002335\">(<font color=\"green\">34.220</font>, <font color=\"green\">-0.67</font>, <font color=\"green\">-1.92%</font>)</span>（4.49亿元）、<span id=\"stock_sh600739\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600739/nc.shtml\" target=\"_blank\">辽宁成大</a></span><span id=\"quote_sh600739\">(<font color=\"green\">17.800</font>, <font color=\"green\">-0.08</font>, <font color=\"green\">-0.45%</font>)</span>（4.31亿元）、<span id=\"stock_sz300197\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300197/nc.shtml\" target=\"_blank\">铁汉生态</a></span><span id=\"quote_sz300197\">(<font color=\"green\">13.600</font>, <font color=\"green\">-0.06</font>, <font color=\"green\">-0.44%</font>)</span>（3.90亿元）、<span id=\"stock_sz000671\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000671/nc.shtml\" target=\"_blank\">阳光城</a></span><span id=\"quote_sz000671\">(<font color=\"green\">5.870</font>, <font color=\"green\">-0.01</font>, <font color=\"green\">-0.17%</font>)</span>（3.65亿元）、<span id=\"stock_sz300156\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300156/nc.shtml\" target=\"_blank\">神雾环保</a></span><span id=\"quote_sz300156\">(<font color=\"red\">32.660</font>, <font color=\"red\">0.05</font>, <font color=\"red\">0.15%</font>)</span>（3.44亿元）、<span id=\"stock_sz000883\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000883/nc.shtml\" target=\"_blank\">湖北能源</a></span><span id=\"quote_sz000883\">(<font color=\"green\">4.990</font>, <font color=\"green\">-0.02</font>, <font color=\"green\">-0.40%</font>)</span>（3.12亿元）和<span id=\"stock_sh601328\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh601328/nc.shtml\" target=\"_blank\">交通银行</a></span><span id=\"quote_sh601328\">(<font color=\"red\">6.120</font>, <font color=\"red\">0.01</font>, <font color=\"red\">0.16%</font>)</span>（3.00亿元）等个股产业资本期间净增持金额达到或超过3亿元。</p>\r\n		<p>\r\n			　　在产业资本的积极布局下，市场也积极回应，上述231只获得产业资本净增持的个股，6月份以来，逾七成个股股价实现上涨，除次新股<span id=\"stock_sz002876\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002876/nc.shtml\" target=\"_blank\">三利谱</a></span><span id=\"quote_sz002876\">(<font color=\"red\">63.240</font>, <font color=\"red\">2.04</font>, <font color=\"red\">3.33%</font>)</span>、<span id=\"stock_sz300658\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300658/nc.shtml\" target=\"_blank\">延江股份</a></span><span id=\"quote_sz300658\">(<font color=\"green\">37.330</font>, <font color=\"green\">-0.41</font>, <font color=\"green\">-1.09%</font>)</span>期间累计涨幅明显外，<span id=\"stock_sz002072\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002072/nc.shtml\" target=\"_blank\">凯瑞德</a></span><span id=\"quote_sz002072\">(<font color=\"red\">33.150</font>, <font color=\"red\">0.41</font>, <font color=\"red\">1.25%</font>)</span>期间累计涨幅也达到31.06%，<span id=\"stock_sz300474\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300474/nc.shtml\" target=\"_blank\">景嘉微</a></span><span id=\"quote_sz300474\">(<font color=\"green\">36.330</font>, <font color=\"green\">-0.92</font>, <font color=\"green\">-2.47%</font>)</span>期间累计涨幅也超20%，达到28.89%，而<span id=\"stock_sz002316\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002316/nc.shtml\" target=\"_blank\">键桥通讯</a></span><span id=\"quote_sz002316\">(<font color=\"green\">13.860</font>, <font color=\"green\">-0.01</font>, <font color=\"green\">-0.07%</font>)</span>（18.04%）、<span id=\"stock_sh600335\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600335/nc.shtml\" target=\"_blank\">国机汽车</a></span><span id=\"quote_sh600335\">(<font color=\"green\">12.000</font>, <font color=\"green\">-0.07</font>, <font color=\"green\">-0.58%</font>)</span>（17.73%）、<span id=\"stock_sz002741\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002741/nc.shtml\" target=\"_blank\">光华科技</a></span><span id=\"quote_sz002741\">(<font color=\"green\">15.760</font>, <font color=\"green\">-0.24</font>, <font color=\"green\">-1.50%</font>)</span>（17.22%）、<span id=\"stock_sz002771\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002771/nc.shtml\" target=\"_blank\">真视通</a></span><span id=\"quote_sz002771\">(<font color=\"red\">29.940</font>, <font color=\"red\">1.59</font>, <font color=\"red\">5.61%</font>)</span>（16.67%）、<span id=\"stock_sz000820\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000820/nc.shtml\" target=\"_blank\">神雾节能</a></span><span id=\"quote_sz000820\">(<font color=\"green\">38.600</font>, <font color=\"green\">-0.04</font>, <font color=\"green\">-0.10%</font>)</span>（16.14%）、铁汉生态（16.02%）、<span id=\"stock_sz002044\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002044/nc.shtml\" target=\"_blank\">美年健康</a></span><span id=\"quote_sz002044\">(<font color=\"red\">16.870</font>, <font color=\"red\">0.05</font>, <font color=\"red\">0.30%</font>)</span>（15.52%）和<span id=\"stock_sz002139\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002139/nc.shtml\" target=\"_blank\">拓邦股份</a></span><span id=\"quote_sz002139\">(<font color=\"green\">10.510</font>, <font color=\"green\">-0.09</font>, <font color=\"green\">-0.85%</font>)</span>（15.09%）等个股期间累计涨幅也均超15%。</p>\r\n		<p>\r\n			　　<strong>大宗交易成交额骤降近五成</strong></p>\r\n		<p>\r\n			　　《证券日报》市场研究中心根据同花顺数据统计发现，5月27日以来截至6月27日（20个交易日），大宗交易累计成交835笔，涉及上市公司340家，期间合计成交额达284.59亿元，较5月27日以前的20个交易日的总成交额529.52亿元骤降244.93亿元，下降幅度达46.26%。</p>\r\n		<p>\r\n			　　具体来看，5月27日以来截至6月27日，发生大宗交易次数在5次以上的个股有45只，期间累计发生大宗交易次数居前的个股包括：<span id=\"stock_sh600519\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600519/nc.shtml\" target=\"_blank\">贵州茅台</a></span><span id=\"quote_sh600519\">(<font color=\"green\">479.690</font>, <font color=\"green\">-4.41</font>, <font color=\"green\">-0.91%</font>)</span>（25次）、<span id=\"stock_sh600715\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600715/nc.shtml\" target=\"_blank\">文投控股</a></span><span id=\"quote_sh600715\">(<font color=\"green\">22.550</font>, <font color=\"green\">-0.07</font>, <font color=\"green\">-0.31%</font>)</span>（23次）、、<span id=\"stock_sz002583\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002583/nc.shtml\" target=\"_blank\">海能达</a></span><span id=\"quote_sz002583\">(<font color=\"green\">15.520</font>, <font color=\"green\">-0.11</font>, <font color=\"green\">-0.70%</font>)</span>（13次）、<span id=\"stock_sh600435\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600435/nc.shtml\" target=\"_blank\">北方导航</a></span><span id=\"quote_sh600435\">(<font color=\"green\">14.300</font>, <font color=\"green\">-0.18</font>, <font color=\"green\">-1.24%</font>)</span>（13次）、<span id=\"stock_sh601318\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh601318/nc.shtml\" target=\"_blank\">中国平安</a></span><span id=\"quote_sh601318\">(<font color=\"green\">49.510</font>, <font color=\"green\">-0.41</font>, <font color=\"green\">-0.82%</font>)</span>（13次）、<span id=\"stock_sh600340\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600340/nc.shtml\" target=\"_blank\">华夏幸福</a></span><span id=\"quote_sh600340\">(<font color=\"green\">34.340</font>, <font color=\"green\">-0.41</font>, <font color=\"green\">-1.18%</font>)</span>（12次）、<span id=\"stock_sz000333\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000333/nc.shtml\" target=\"_blank\">美的集团</a></span><span id=\"quote_sz000333\">(<font color=\"green\">43.050</font>, <font color=\"green\">-0.95</font>, <font color=\"green\">-2.16%</font>)</span>（11次）、<span id=\"stock_sz300266\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300266/nc.shtml\" target=\"_blank\">兴源环境</a></span><span id=\"quote_sz300266\">(<font color=\"green\">29.950</font>, <font color=\"green\">-0.32</font>, <font color=\"green\">-1.06%</font>)</span>（10次）和<span id=\"stock_sh603899\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh603899/nc.shtml\" target=\"_blank\">晨光文具</a></span><span id=\"quote_sh603899\">(<font color=\"green\">17.350</font>, <font color=\"green\">-0.18</font>, <font color=\"green\">-1.03%</font>)</span>（10次）等。</p>\r\n		<p>\r\n			　　大宗交易成交额方面，上述个股中，有75只个股期间累计大宗交易成交额超1亿元，文投控股（10.42亿元）、<span id=\"stock_sz002509\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002509/nc.shtml\" target=\"_blank\">天广中茂</a></span><span id=\"quote_sz002509\">(<font color=\"black\">9.200</font>, <font color=\"black\">0.00</font>, <font color=\"black\">0.00%</font>)</span>（10.07亿元）、兴源环境（9.49亿元）、<span id=\"stock_sz300003\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300003/nc.shtml\" target=\"_blank\">乐普医疗</a></span><span id=\"quote_sz300003\">(<font color=\"green\">21.200</font>, <font color=\"green\">-0.22</font>, <font color=\"green\">-1.03%</font>)</span>（9.41亿元）、东方园林（8.23亿元）、<span id=\"stock_sz002236\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002236/nc.shtml\" target=\"_blank\">大华股份</a></span><span id=\"quote_sz002236\">(<font color=\"green\">23.300</font>, <font color=\"green\">-0.15</font>, <font color=\"green\">-0.64%</font>)</span>（7.91亿元）、美的集团（6.2亿元）、<span id=\"stock_sz002294\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002294/nc.shtml\" target=\"_blank\">信立泰</a></span><span id=\"quote_sz002294\">(<font color=\"green\">35.640</font>, <font color=\"green\">-0.25</font>, <font color=\"green\">-0.70%</font>)</span>（6.01亿元）、<span id=\"stock_sz000651\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000651/nc.shtml\" target=\"_blank\">格力电器</a></span><span id=\"quote_sz000651\">(<font color=\"green\">41.110</font>, <font color=\"green\">-0.32</font>, <font color=\"green\">-0.77%</font>)</span>（5.73亿元）、<span id=\"stock_sz002647\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz002647/nc.shtml\" target=\"_blank\">民盛金科</a></span><span id=\"quote_sz002647\">(<font color=\"red\">38.950</font>, <font color=\"red\">0.10</font>, <font color=\"red\">0.26%</font>)</span>（5.36亿元）、<span id=\"stock_sh600741\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600741/nc.shtml\" target=\"_blank\">华域汽车</a></span><span id=\"quote_sh600741\">(<font color=\"green\">24.060</font>, <font color=\"green\">-0.23</font>, <font color=\"green\">-0.95%</font>)</span>（5.35亿元）等个股期间累计大宗交易成交额均在5亿元以上。</p>\r\n		<p>\r\n			　　二级市场表现方面，上述大宗交易较为活跃的个股中，有260只个股股价6月份以来实现上涨，占比76.47%。其中，有76只个股期间累计涨幅超过10%，而<span id=\"stock_sz300056\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300056/nc.shtml\" target=\"_blank\">三维丝</a></span><span id=\"quote_sz300056\">(<font color=\"green\">14.850</font>, <font color=\"green\">-0.29</font>, <font color=\"green\">-1.92%</font>)</span>（42.29%）、凯瑞德（31.06%）、<span id=\"stock_sz000022\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000022/nc.shtml\" target=\"_blank\">深赤湾A</a></span><span id=\"quote_sz000022\">(<font color=\"green\">30.570</font>, <font color=\"green\">-1.28</font>, <font color=\"green\">-4.02%</font>)</span>（28.27%）、大华股份（25.98%）、<span id=\"stock_sh603078\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh603078/nc.shtml\" target=\"_blank\">江化微</a></span><span id=\"quote_sh603078\">(<font color=\"green\">77.220</font>, <font color=\"green\">-1.17</font>, <font color=\"green\">-1.49%</font>)</span>（21.89%）、美的集团（21.82%）、格力电器（21.57%）、兴源环境（21.57%）、华域汽车（21.51%）、<span id=\"stock_sh600570\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600570/nc.shtml\" target=\"_blank\">恒生电子</a></span><span id=\"quote_sh600570\">(<font color=\"green\">45.060</font>, <font color=\"green\">-0.29</font>, <font color=\"green\">-0.64%</font>)</span>（21.32%）、<span id=\"stock_sh600309\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600309/nc.shtml\" target=\"_blank\">万华化学</a></span><span id=\"quote_sh600309\">(<font color=\"red\">28.000</font>, <font color=\"red\">0.21</font>, <font color=\"red\">0.76%</font>)</span>（20.15%）和<span id=\"stock_sz000002\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz000002/nc.shtml\" target=\"_blank\">万科A</a></span><span id=\"quote_sz000002\">(<font color=\"red\">25.750</font>, <font color=\"red\">0.21</font>, <font color=\"red\">0.82%</font>)</span>（20.13%）等个股期间累计涨幅均在20%以上。</p>\r\n		<p>\r\n			　　<strong>定增募资规模下降67.89%</strong></p>\r\n		<div class=\"otherContent_01\" id=\"ad_44099\" style=\"display: block; margin: 10px 20px 10px 0px; float: left; overflow: hidden; clear: both; padding: 4px; width: 300px; height: 250px;\">\r\n			&nbsp;</div>\r\n		<p>\r\n			　　《证券日报》市场研究中心根据同花顺数据统计发现，5月27日以来截至6月27日（20个交易日），沪深两市共有6家上市公司已经实施定向增发，合计实际募集资金119.88亿元，较5月27日以前的20个交易日的18家公司实际募集资金373.37亿元下降253.49亿元，下降幅度达67.89%。具体来看，上述6家公司按定向增发实际募集资金排序，分别为：<span id=\"stock_sh600584\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600584/nc.shtml\" target=\"_blank\">长电科技</a></span><span id=\"quote_sh600584\">(<font color=\"green\">16.310</font>, <font color=\"green\">-0.18</font>, <font color=\"green\">-1.09%</font>)</span>（52.61亿元）、<span id=\"stock_sh600881\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600881/nc.shtml\" target=\"_blank\">亚泰集团</a></span><span id=\"quote_sh600881\">(<font color=\"green\">5.210</font>, <font color=\"green\">-0.02</font>, <font color=\"green\">-0.38%</font>)</span>（30.13亿元）、<span id=\"stock_sh600409\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600409/nc.shtml\" target=\"_blank\">三友化工</a></span><span id=\"quote_sh600409\">(<font color=\"red\">9.810</font>, <font color=\"red\">0.08</font>, <font color=\"red\">0.82%</font>)</span>（13.86亿元）、<span id=\"stock_sh600260\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600260/nc.shtml\" target=\"_blank\">凯乐科技</a></span><span id=\"quote_sh600260\">(<font color=\"red\">25.470</font>, <font color=\"red\">0.35</font>, <font color=\"red\">1.39%</font>)</span>（9.80亿元）、<span id=\"stock_sz300044\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sz300044/nc.shtml\" target=\"_blank\">赛为智能</a></span><span id=\"quote_sz300044\">(<font color=\"red\">19.950</font>, <font color=\"red\">0.16</font>, <font color=\"red\">0.81%</font>)</span>（7.63亿元）和<span id=\"stock_sh600661\"><a class=\"keyword\" href=\"http://finance.sina.com.cn/realstock/company/sh600661/nc.shtml\" target=\"_blank\">新南洋</a></span><span id=\"quote_sh600661\">(<font color=\"green\">21.240</font>, <font color=\"green\">-0.23</font>, <font color=\"green\">-1.07%</font>)</span>（5.84亿元）。</p>\r\n		<p>\r\n			　　统计显示，上述6只个股中，股价跌破定增发行价的个股有2只，分别为：新南洋、长电科技。</p>\r\n		<p>\r\n			　　对此，分析人士指出，从短期来看，减持新规使定增市场可参与资金迅速减少，将明显提升定增资金的议价能力，定增市场将由卖方市场转变为买方市场，预期折价率将大幅提升，定增资产投资价值也将大幅提升。从长期来看，减持新规将拉长定增资金的退出时间，预计未来发行定增的上市公司数量会显著下降，但上市公司质量将有所提升，未来定增投资将更注重企业成长与价值本身。</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
