INSERT INTO `cms_article_data` VALUES ('43520', '<div class=\"attributes\" id=\"attributes\" style=\"margin: 0px; padding: 0px; color: rgb(64, 64, 64); font-family: tahoma, arial, 微软雅黑, sans-serif; font-size: 12px; line-height: 18px; white-space: normal;\">\r\n	<div class=\"attributes-list\" id=\"J_AttrList\" style=\"margin: 0px 0px 10px; padding: 0px; clear: both; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-style: none solid solid; border-right-color: rgb(230, 230, 230); border-bottom-color: rgb(230, 230, 230); border-left-color: rgb(230, 230, 230);\">\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>&nbsp; &nbsp; &nbsp; 意式轻奢男装品牌PALONGACO正式入驻苏州新光三越百货。新光三越在百货界以经营高端百货著称，由台湾新光集团和日本三越集团合资组建。</strong></span></p>\r\n		<p align=\"center\" style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><img alt=\"\" src=\"http://img.china-ef.com/news/201507/07/2015070708342581.jpg\" style=\"max-width: 550px; margin: auto; overflow: hidden; opacity: 100;\" /></strong></span></p>\r\n		<p align=\"center\" style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><img alt=\"\" src=\"http://img.china-ef.com/news/201507/07/2015070708342935.jpg\" style=\"max-width: 550px; margin: auto; overflow: hidden; opacity: 100;\" /></strong></span></p>\r\n		<p align=\"center\" style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><img alt=\"\" src=\"http://img.china-ef.com/news/201507/07/2015070708344435.jpg\" style=\"max-width: 550px; border-width: 2px; border-style: solid; margin-top: auto; margin-bottom: auto; overflow: hidden; opacity: 100;\" /></strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>　　目前在台湾拥有13个店19个馆，2008年在北京开设新光天地，总营业面积100多万平方米。新光三越目前共有2600多个国际一线顶级品牌，并汇集了世界各地超过2万种以上的日常生活用品。</strong></span></p>\r\n		<p align=\"center\" style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><img alt=\"\" src=\"http://img.china-ef.com/news/201507/07/2015070708344737.jpg\" style=\"max-width: 550px; border-width: 1px; border-style: solid; margin: auto; overflow: hidden; opacity: 100;\" /></strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; padding: 0px; margin: 10px 0px 0px; color: rgb(37, 37, 37); font-stretch: normal; font-family: SimSun;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>　　它被期许：不仅将成为园区的地标，而且是苏州人的骄傲同时赢得国际友人的尊敬和喜爱晴阴风雨，它是园区最温暖、最愉悦、最美丽的地方。</strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>在特步携手格男仕男装&ldquo;步拘一格，混搭风潮&rdquo;签约仪式上，格男仕男装CEO超人当场表示，格男仕男装线下实体店将于近日开业，当时便造成现场一片哗然，引来了多方关注。</strong></span></p>\r\n		<div class=\"img_wrapper\" style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 0px 0px 10px; padding: 0px; position: relative; text-align: center; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><img alt=\" \" src=\"http://minnan.sinaimg.cn/2013/1024/U9557P1433DT20131024172852.jpg\" style=\"vertical-align: top; border: 1px solid black; display: inline; margin: 0px auto; z-index: 1; position: relative;\" title=\" \" /></strong></span></div>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>　　果不其然，10月1日格男仕男装第一家实体店在江西永兴开业，而这家实体店只是个开始，在10月底，格男仕男装厦门万达店、晋江万达店等将相继开业，预计到年底格男仕男装将在中国中南部的二三线城市开30多家实体店。</strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>　　曾多次在公开场合表明不会走线下的格男仕男装为何此时反行其道？据格男仕男装CEO超人介绍，近两年来，O2O模式席卷了整个电商企业，是未来服装电商发展的趋势，也是服装电商探索的新模式。O2O模式其最大的特点是线上线下的融合，并充分结合传统零售与电子商务的优势。顾客既可以充分享受&ldquo;逛店&rdquo;的乐趣，又能够享受到一站式购物、方便实惠、送货上门等电子商务的便捷。格男仕男装开设线下实体店，就是在为O2O模式的转化做准备，以提升用户的体验度，并非将全部精力转入到线下渠道。</strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>　　成立于2010年的格男仕男装，以2年多的时间做到了上亿的体量。2013年格男仕男装倾力打造&ldquo;时尚通勤风&rdquo;。</strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span></p>\r\n		<p style=\"white-space: normal; font-variant-ligatures: normal; orphans: 2; margin: 20px 0px; padding: 0px; color: rgb(69, 69, 69); font-family: 宋体; text-align: right;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><font style=\"font-size: 10.5pt; letter-spacing: 0pt; text-indent: 21pt;\">联系我哦</font><span style=\"font-size: 10.5pt; letter-spacing: 0pt; text-indent: 21pt;\">:18892687121</span></strong></span></p>\r\n		<p class=\"attr-list-hd tm-clear\" style=\"margin: 0px; padding: 5px 20px; line-height: 22px; color: rgb(153, 153, 153);\">\r\n			&nbsp;</p>\r\n		<p class=\"p\" style=\"font-variant-ligatures: normal; orphans: 2; widows: 2; margin: 15pt 0pt; text-indent: 21pt; padding: 0pt; line-height: 19.5pt; text-align: right;\">\r\n			<span style=\"font-family: 微软雅黑;\"><strong><span style=\"color: rgb(69, 69, 69); letter-spacing: 0pt; font-size: 10.5pt;\">邮箱:</span><span style=\"white-space: normal; font-size: 13px; widows: 1;\">fifacommandos@gmail.com</span></strong></span></p>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', null, '1');
