INSERT INTO `cms_article_data` VALUES ('58836', '<p>\r\n	&nbsp;</p>\r\n<h3 id=\"1_1\" style=\"margin: 15px 0px; font-family: \'Microsoft Yahei\'; line-height: inherit; color: rgb(4, 0, 0); text-rendering: optimizeLegibility; font-size: 14px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 1em; white-space: normal;\">\r\n	1什么是微盟？</h3>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	微盟是打造的一个专门针对微信公众账号提供营销推广服务的第三方平台。主要功能是针对微信商家公众号提供与众不同的、有针对性的营销推广服务。通过微盟平台，用户可以轻松管理自己的微信各类信息，对微信公众账号进行维护、开展智能机器人、在线发优惠劵、抽奖、刮奖、派发会员卡、打造微官网、开启微团购等多种活动，对微信营销实现有效监控，极大扩展潜在客户群和实现企业的运营目标。微盟平台很好的弥补了微信公众平台本身功能不足、针对性不强、交互不便利的问题，为商家公众账号提供更为贴心的、且是核心需求的功能和服务。在线优惠劵、转盘抽奖、微信会员卡等推广服务更是让微信成为商家推广的利器。智能客服的可调教功能让用户真正从微信繁琐的日常客服工作中解脱出来，真正成为商家便利的新营销渠道。</p>\r\n<h3 id=\"1_2\" style=\"margin: 15px 0px; font-family: \'Microsoft Yahei\'; line-height: inherit; color: rgb(4, 0, 0); text-rendering: optimizeLegibility; font-size: 14px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 1em; white-space: normal;\">\r\n	2 企业为什么开通微信公众号</h3>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	移动互联网的趋势</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	平台化电子商务最缺的不是商家是消费者。</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	哪里有人哪里就有商业，哪里就有盈利空间。据第三方统计70%的手机用户开通了个人微信，其年龄涵盖了小学生至老年人，各年龄阶层的人群。截止目前腾讯已拥有4亿的微信用户，7亿的qq用户。消费者才是企业追逐的目标，人的数量决定了财富的数量。</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	微信营销的趋势与巨大利润空间</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	微信营销是继微博后的最大营销机遇！</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	淘宝的第一批用户是一批什么都敢尝试的大学生，如今他们已经大多成为千万、亿万的商务人群。微信营销时代已经到来，其势不可挡的趋势，已严重冲击着传统的销售渠道。错过了淘宝时代，错过了微博时代，不要错过微信营销时代。基于微信营销的第一批企业必然成为未来的微信首批富豪。</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	微信的粘性和使用惯性</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	没有人会天天上淘宝，也没有人会天天刷微博&mdash;&mdash;但微信可以。</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	首先微信是一款沟通工具，实时通讯的特性决定了其使用价值，朋友圈的分享让社会化关系代替了点对点的交互，这不仅是一种关系，更是影响力！更是控制力！基于关系网的微信，平民也有明星的感觉。其用户黏度没有任何一个产品可以比拟。微信用其巨大的威力吸引、稳定着消费者，消费者已经准备好了，企业还不来吗？</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	企业微信公众账号的作用与开通意义</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	企业微信公众账号是企业媒体发布平台、销售信息发布平台、危机公关平台、消费者互动平台、促销活动开展平台、新品展示平台、产品在线销售平台、网上支付平台、调研平台、公司企业文化传播平台、人才招聘平台等，一切企业关注的，企业需要的在企业微信公众账号都可以实现！！</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	企业为什么要开通、运营企业微信公众账号</h4>\r\n<p>\r\n	<img alt=\"\" src=\"http://192.168.0.188:8088/yzf/userfiles/1/images/cms/article/2017/08/8888.png\" style=\"height: 381px; width: 406px;\" /></p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	重点的关键点&mdash;&mdash;品牌、产品销售、人才、客户</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	1) 企业微信公众账号的媒体属性:10万个粉丝等于地方性报纸;100万个粉丝等于全国性的报纸头条新闻。</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	2) 产品销售平台:在线购买、在线支付、促销活动。最活跃的、反应速度最快、互动最强的电子商务平台</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	3) 人才招聘的平台：免费的人才招聘渠道，未来人才招聘的主流渠道</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	4) 客户：客户在线互动、客户体验、新品试用、消费者意见调研、有奖活动、在线咨询甚至网上订餐、送货服务、钟点服务、上门维修等。</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	企业微信公众平台的现状</h4>', '', null, '1');
INSERT INTO `cms_article_data` VALUES ('59423', '<h3 id=\"1_1\" style=\"margin: 15px 0px; font-family: \'Microsoft Yahei\'; line-height: inherit; color: rgb(4, 0, 0); text-rendering: optimizeLegibility; font-size: 14px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 1em; white-space: normal;\">\r\n	1什么是微盟？</h3>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	微盟是打造的一个专门针对微信公众账号提供营销推广服务的第三方平台。主要功能是针对微信商家公众号提供与众不同的、有针对性的营销推广服务。通过微盟平台，用户可以轻松管理自己的微信各类信息，对微信公众账号进行维护、开展智能机器人、在线发优惠劵、抽奖、刮奖、派发会员卡、打造微官网、开启微团购等多种活动，对微信营销实现有效监控，极大扩展潜在客户群和实现企业的运营目标。微盟平台很好的弥补了微信公众平台本身功能不足、针对性不强、交互不便利的问题，为商家公众账号提供更为贴心的、且是核心需求的功能和服务。在线优惠劵、转盘抽奖、微信会员卡等推广服务更是让微信成为商家推广的利器。智能客服的可调教功能让用户真正从微信繁琐的日常客服工作中解脱出来，真正成为商家便利的新营销渠道。</p>\r\n<h3 id=\"1_2\" style=\"margin: 15px 0px; font-family: \'Microsoft Yahei\'; line-height: inherit; color: rgb(4, 0, 0); text-rendering: optimizeLegibility; font-size: 14px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 1em; white-space: normal;\">\r\n	2 企业为什么开通微信公众号</h3>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	移动互联网的趋势</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	平台化电子商务最缺的不是商家是消费者。</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	哪里有人哪里就有商业，哪里就有盈利空间。据第三方统计70%的手机用户开通了个人微信，其年龄涵盖了小学生至老年人，各年龄阶层的人群。截止目前腾讯已拥有4亿的微信用户，7亿的qq用户。消费者才是企业追逐的目标，人的数量决定了财富的数量。</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	微信营销的趋势与巨大利润空间</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	微信营销是继微博后的最大营销机遇！</p>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-indent: 2em; color: rgb(0, 0, 0); white-space: normal;\">\r\n	淘宝的第一批用户是一批什么都敢尝试的大学生，如今他们已经大多成为千万、亿万的商务人群。微信营销时代已经到来，其势不可挡的趋势，已严重冲击着传统的销售渠道。错过了淘宝时代，错过了微博时代，不要错过微信营销时代。基于微信营销的第一批企业必然成为未来的微信首批富豪。</p>\r\n<h4 style=\"margin: 0px; font-family: 微软雅黑, 黑体, sans-serif; font-weight: 400; line-height: 12px; color: rgb(0, 0, 0); text-rendering: optimizeLegibility; font-size: 12px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); white-space: normal;\">\r\n	微信的粘性和使用惯性</h4>\r\n<p style=\"margin: 15px 0px; padding: 0px; border: 0px; vertical-align: baseline; font-stretch: inherit; line-height: 28px; font-family: 微软雅黑, 黑体, sans-serif; -webkit-tap-highlight-color: rg